  const formSubmitHandler = (e) => {
    e.preventDefault();
    console.log(e.target.value);
    props.onAddUser();
  };
  return (
    <form onSubmit={formSubmitHandler}>
      <div>
        <label>Username</label>
        <input type="text" onChange />
      </div>
      <div>
        <label>Age(Years)</label>
        <input type="number" />
      </div>
      <Button>Add User</Button>
    </form>
  );
};

